import React from "react";

const Header = (props) => {
  console.log("In Header.js");
  console.log(props);

  return (
    <div>
      <h1>Header</h1>
      <p>
        I am {props.myObj.name}. I am {props.myObj.age} years old.{" "}
      </p>
      <div>
        <h4>Hobbies</h4>
        <ul>props.myObj.hobbies.map((input) => {<li>input</li>})</ul>
      </div>
    </div>
  );
};

export default Header;
